  if (selectedSkillkey == "") $(".mainskillli[skillkey = \"".concat(selectedSkillkey, "\"][cadre = \"").concat(cadre, "\"]")).removeClass('d-none');else $(".mainskillli[skillkey = \"".concat(selectedSkillkey, "\"]")).removeClass('d-none'); //Ajouter le skill selected à l'image afficher

  selectedMainSkill.attr('src', src);
